'use strict';

/**
* Returns the axis tick values.
*
* @private
* @returns {(Array|null)} ticks
*/
function get() {
	/* jshint validthis: true */ // TODO: eslint
	if ( this._ticks ) {
		return this._ticks.slice();
	}
	return this._ticks;
} // end FUNCTION get()


// EXPORTS //

module.exports = get;
